INSERT INTO `job_description` VALUES (51,'20','',4,'Fresher','Handling the sales inquiry and solving them Creating a marketing strategy to bring business to the company Organizing a meeting with the client and be the face of the company in the market Maintain a good relationship with clients Handling client\'s requirements and queries','Must possess strong customer service skills Excellent written and verbal communication Must have good negotiation skills Must be able to create good presentations Must have excellent interpersonal skills Must be detail oriented and an active listener Ability to work under pressure','2019-12-21 06:13:08'),(52,'21','',6,'Fresher','A PHP Developer is responsible for creating and implementing an array of Web-based products using PHP, MySQL, Ajax, and JavaScript. You develop back-end components, connect the application with other web services, and assist front-end developers by ensuring their work integrates with the application. Also, you might be asked to develop and integrate plug-ins for popular frameworks.','The next step is to use your technical knowledge to develop the site/page as per the final plan. What you create must be dynamic and include the advantages of PHP Script. A PHP Developer is expected to develop a portal with an optimised database.','2019-12-21 06:31:02'),(79,'22','ss',6,'Fresher','<ul style=\"color: rgba(0, 0, 0, 0.87); font-family: Roboto, sans-serif; font-size: 16px;\"><li>Defines site objectives by analyzing user requirements; envisioning system features and functionality.</li><li>Designs and develops user interfaces to internet/intranet applications by setting expectations and features priorities throughout development life cycle; determining design methodologies and tool sets; completing programming using languages and software products; designing and conducting tests.</li><li>Recommends system solutions by comparing advantages and disadvantages of custom development and purchase alternatives.</li><li>Integrates applications by designing database architecture and server scripting; studying and establishing connectivity with network systems, search engines, and information servers.</li><li>Creates multimedia applications by using authoring tools.</li><li>Completes applications development by coordinating requirements, schedules, and activities; contributing to team meetings; troubleshooting development and production problems across multiple environments and operating platforms.</li><li>Supports users by developing documentation and assistance tools.</li><li>Updates job knowledge by researching new internet/intranet technologies and software products; participating in educational opportunities; reading professional publications; maintaining personal networks; participating in professional organizations.</li><li>Enhances organization reputation by accepting ownership for accomplishing new and different requests; exploring opportunities to add value to job accomplishments.</li></ul> ','<ul style=\"color: rgba(0, 0, 0, 0.87); font-family: Roboto, sans-serif; font-size: 16px;\"><li>Defines site objectives by analyzing user requirements; envisioning system features and functionality.</li><li>Designs and develops user interfaces to internet/intranet applications by setting expectations and features priorities throughout development life cycle; determining design methodologies and tool sets; completing programming using languages and software products; designing and conducting tests.</li><li>Recommends system solutions by comparing advantages and disadvantages of custom development and purchase alternatives.</li><li>Integrates applications by designing database architecture and server scripting; studying and establishing connectivity with network systems, search engines, and information servers.</li><li>Creates multimedia applications by using authoring tools.</li><li>Completes applications development by coordinating requirements, schedules, and activities; contributing to team meetings; troubleshooting development and production problems across multiple environments and operating platforms.</li><li>Supports users by developing documentation and assistance tools.</li><li>Updates job knowledge by researching new internet/intranet technologies and software products; participating in educational opportunities; reading professional publications; maintaining personal networks; participating in professional organizations.</li><li>Enhances organization reputation by accepting ownership for accomplishing new and different requests; exploring opportunities to add value to job accomplishments.</li></ul> ','2020-02-01 09:53:36'),(54,'23','',1,'0- Fresher','We are looking for an SEO/SEM expert to manage all search engine optimization and marketing activities.  You will be responsible for managing all SEO activities such as content strategy, link building and keyword strategy to increase rankings on all major search networks. You will also manage all SEM campaigns on Google, Yahoo and Bing in order to maximize ROI','Proven SEO experience Proven SEM experience managing PPC campaigns across Google, Yahoo and Bing. Solid understanding of performance marketing, conversion, and online customer acquisition In-depth experience with website analytics tools (e.g, Google Analytics, NetInsight, Omniture, WebTrends) Experience with bid management tools (e.g., Click Equations, Marin, Kenshoo, Search Ignite) Experience with A/B and multivariate experiments Working knowledge of HTML, CSS, and JavaScript development and constraints Knowledge of ranking factors and search engine algorithms Up-to-date with the latest trends and best practices in SEO and SEM BS/MS degree in a quantitative, test-driven field','2019-12-24 09:08:41');
